import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBMask,
  MDBRow,
  MDBCol,
  MDBView,
  MDBContainer,
  MDBFormInline,
  MDBAnimation,
  MDBBtn, MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText
} from "mdbreact";
import "../index.css";
import CardExample from './event1';

class Events extends React.Component {
    render() {
        return(

            <div>
            <h2 align="center">Events</h2>
            <br/><br/>
            <MDBContainer>
                <MDBRow align="center">
                    <MDBCol md="3" lg="3" sm="5"><CardExample/></MDBCol>
                    <MDBCol md="3" lg="3" sm="5">Hey There</MDBCol>
                    <MDBCol md="3" lg="3" sm="5">Hey There</MDBCol>
                    <MDBCol md="3" lg="3" sm="5">Hey There</MDBCol>

                </MDBRow>
                <br/><br/>
            </MDBContainer>
            </div>
        );
    }
}

export default Events;
